import React from "react";

const Error404 = () =>{
    return(

        <div className="container">
            <div className="row my-5">
                <div className="col text-center">
                    <h1>Error <b>404</b></h1>
                    <h3>La pagina no existe</h3>
                </div>
            </div>
        </div>


    )
}

export default Error404;
